import React,{createContext} from "react";
import { Route , Switch } from 'react-router-dom';
import First from './head';
import Sec from './body';

const X = () =>{
  return (
    <>
      <Switch>
        <Route exact path='/' component={First}></Route>
        <Route path='/sec' component={Sec}></Route>
        <Route component={Sec}></Route>
      </Switch>
    </>
  )
}

export default X;
